import React, { useEffect } from "react";
import atoz from "../assests/atoz.jpeg";
import shirt from "../assests/shirts.jpeg";
import belts from "../assests/belts.jpeg";
import watch from "../assests/watch.jpeg";
import { Link } from "react-router-dom";
import firebase from "../Firebase.js";

const Firstpage = (props) => {
  const db = firebase.firestore();
  useEffect(() => {
    db.collection("categories")
      .get()
      .then(async (snapshot) => {
        const data = [];
        snapshot.forEach((doc) => data.push(doc.data()));
        console.log(data);
      });
  });
  return (
    <div className="box1f">
      <img src={atoz} className="fimg" width="400" height="150" />
      <div className="categ">
        <Link
          to="/"
          style={{
            textDecoration: "none",
            color: "black",
            fontSize: 14,
          }}
        >
          <div className="categ1">
            <img src={shirt} className="cimg" width="150" height="150" />
            Men's Shirts
          </div>
        </Link>
        <Link
          to="/"
          style={{
            textDecoration: "none",
            color: "black",
            fontSize: 14,
          }}
        >
          <div className="categ1">
            <img src={belts} className="cimg" width="150" height="150" />
            Belts {"&"} Wallets
          </div>
        </Link>
        <Link
          to="/"
          style={{
            textDecoration: "none",
            color: "black",
            fontSize: 14,
          }}
        >
          <div className="categ1">
            <img src={watch} className="cimg" width="150" height="150" />
            Watches
          </div>
        </Link>
      </div>
    </div>
  );
};

export default Firstpage;
